function lon2tile(lon,zoom) { return (Math.floor((lon+180)/360*Math.pow(2,zoom))); }
function lat2tile(lat,zoom)  { return (Math.floor((1-Math.log(Math.tan(lat*Math.PI/180) + 1/Math.cos(lat*Math.PI/180))/Math.PI)/2 *Math.pow(2,zoom))); }

function getGeoJsonTile(lati, longi, zoomi){
	return 'https://data.osmbuildings.org/0.2/anonymous/tile/' + zoomi.toString() + '/' + lon2tile(longi,zoomi).toString() + '/' + lat2tile(lati,zoomi).toString() + '.json';
}

function setGeoJsonTileWithStyle(tile_id){
	return {
		id: tile_id,
		type: 'fill-extrusion',
		minzoom: 15,
		paint:{
			// 'fill-extrusion-height': ['get', 'height'],
			'fill-extrusion-height': [
				'interpolate',
				['linear'],
				['zoom'],
				15,
				0,
				15.05,
				['get', 'height'],
			],
			'fill-extrusion-base': [
				'interpolate',
				['linear'],
				['zoom'],
				15,
				0,
				15.05,
				0, //min_height not in json
			],
			'fill-extrusion-color': '#FFFFFF',
			//'fill-extrusion-color': '#474747',
			//'fill-extrusion-color': '#dbdbdb',
			'fill-extrusion-opacity': 0.5,
		},
		source: tile_id,
	};
}
