map.on('click', (e) => {
	const features = map.queryRenderedFeatures(e.point);
	 
	// Limit the number of properties we're displaying for
	// legibility and performance
	const displayProperties = ['properties'];
	const displayId = ['id'];
	
	const displayFeatures = features.map((feat) => {
		const displayFeat = {};
		displayProperties.forEach((prop) => {
			displayFeat[prop] = feat[prop];
		});
		return displayFeat;
	});
	
	const displayIds = features.map((feat) => {
		const displayIds = {};
		displayId.forEach((prop) => {
			displayIds[prop] = feat[prop];
		});
		return displayIds;
	});
	
	
	try {
		var buildingName = displayFeatures[0].properties.name;
		var buildingId = displayIds[0].id;
	} catch (e){
		//shut up
	};
	
	if (buildingName == undefined){ buildingName = "-";}
	if (buildingId == undefined){ buildingId = "-";}
	
	
	
	
	document.getElementById("subtitle").innerHTML = "Name: " + buildingName + " ID: " + buildingId;
		
	
});

