function createMarker(color, lat, lng, popup, map){
	return new maplibregl.Marker({
		color: color,
		draggable: false
		}).setLngLat([lng, lat])
		.setPopup(new maplibregl.Popup().setHTML(popup))
	.addTo(map);
}

