function easyAddSource(id, data){
	map.addSource(id, {
	  generateId: true,
	  'type': 'geojson',
	  'data': data
	});
}

function easyAddLayer(id, source, color){
	map.addLayer({
        'id': id,
        'type': 'line',
        'source': source,
        'layout': {
            'line-join': 'round',
            'line-cap': 'round'
        },
        'paint': {
            'line-color': color,
            'line-width': 10,
			'line-opacity': 1,
        }
    });
	
	map.setPaintProperty(
	  source, 
	  'line-opacity',
	  ['match', ['get', 'id'], 0, ['get', 'signal-strength'] , ['get', 'signal-strength']]
	);
}

